import React from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";

import cover from '../cover.jpg'


function Home() {
  return (
    <div style = {{position: 'absolute', top: 0, left: 0, display: 'block', width: '100%'}}>
        <img style = {{width: '100%', verticalAlign: 'middle'}} src = {cover} alt="cover photo"/>

        <div style = {{height: '100px', backgroundColor: 'white', position: 'relative', opacity: 0.5, top: '50px'}}></div>
        <div style = {{height: '700px', backgroundColor: 'black'}}></div>
    </div>
  );
}

export default Home;
